import React, { useState } from 'react';
import axios from 'axios';

const Login = (props) =>
{
    const [email, setEmail] = useState('');
    const [pass, setPass] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();

        try {
            const response = axios.post('https://localhost:8000/login', {
                email: email,
                password: pass,
            });

            console.log(response.data);
        } catch (error) {
            console.log(error);
        }

    }

    return (
        <div className='auth-form-container'>
            <form className='login-form' onSubmit={handleSubmit}>
                <label htmlFor="email">Email</label>
                <input value={email} onChange={(e) => setEmail(e.target.value)} type="email" placeholder="youremail@domain.com"/>
                <label htmlFor="password">Password</label>
                <input value={pass} onChange={(e) => setPass(e.target.value)} type="password" placeholder='Password'/>
                <button type="submit">Log In</button>
            </form>
            <button className='link-btn' onClick={() => props.onFormSwitch('register')}>Haven't made an account yet? Register here.</button>
        </div>
    );
}

export default Login;
